import React from 'react'

const DeleteStudentByID = () => {

  let allStudents = useSelector((state) => state.students)
  return (
    <>
      <ul>
        {allStudents.map(student => {
          return <li>{student.fName} <br />{student.city} </li>
        })}
      </ul>
    </>
  )
}

export default DeleteStudentByID
